import { get, post, patch, put, del } from './axios-c';


export const _login = async (data) => await post('/loc/users/login', data)









export const _goodsAll = async () => await get('/goods/getAll')
export const _addItem = async (data) => await post('/goods/item', data)
export const _upItem = async (id, data) => await patch(`/goods/item/${id}`, data)
export const _delItem = async (id, data) => await del(`/goods/item/${id}`, data)




export const _ordersAll = async () => await get('/order/getAll')
export const _newItem = async (data) => await post('/order/item', data)
export const _updItem = async (id, data) => await patch(`/order/item/${id}`, data)
export const _deleItem = async (id, data) => await del(`/order/item/${id}`, data)
